const CountriesList = ({data}) => {
    
    return ( 
        <div className="countries-list grid grid-cols-4">
            {
                data.map((country, idx)=>(
                    <div className="country-block bg-white m-8" key={idx}>
                        <img src={country.flag} alt="" className="w-full h-48 object-cover"/>
                        <div className="country-info p-6 mb-6">
                            <div className="name font-extrabold mb-3">{country.name}</div>
                            <div className="population font-semibold">
                                Population: <span className="font-normal">{country.population}</span>
                            </div>
                            <div className="region font-semibold">
                                Region: <span className="font-normal">{country.region}</span>
                            </div>
                            <div className="capital font-semibold">
                                Capital: <span className="font-normal">{country.capital}</span>
                            </div>
                        </div>
                    </div>
                ))
                
            }
        </div>
     );
}
 
export default CountriesList;
